import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  render() {
    let todo = [{name: 'farrukh'}, {name: 'Taha'}]
    return (
      <div>
        <ul>
          { todo.map((item, index) => {
              return <li key={index} style={{color: 'blue', listStyle: none}}>{item.name}</li>
          })}
        </ul>
      </div>
    )
  }  
}

export default App;
